// This is the main entrypoint for the admin layout
// Things that need to be set up globally for all admin related pages go here.
// Run this script by adding <%= javascript_pack_tag 'admin' %> to the head of your layout file,
// like app/views/layouts/admin.html.erb.

document.addEventListener('DOMContentLoaded', () => {
  var showBrian = function () {
    document.body.style.background = "url('data:image/png;base64,')";
  };

  // Here's the easter egg keystrokes
  var pattern = ['Tab', 'b', 's'];
  var current = 0;
  var showing = false;

  // This is only running on admin pages so ...  forgive me.
  var keyHandler = function (event) {
    // If the key isn't in the pattern, or isn't the current key in the pattern, reset
    if (pattern.indexOf(event.key) < 0 || event.key !== pattern[current]) {
      current = 0;
      return;
    }

    // Update how much of the pattern is complete
    current++;

    // If complete, take action and reset
    if (pattern.length === current) {
      current = 0;
      if(showing) {
        document.body.style.background = '';
        showing = false;
      } else {
        showBrian();
        showing = true;
      }
    }
  };

  document.addEventListener('keydown', keyHandler, false);

}); // END DOMContentLoaded
